import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import LedController from "./components/ledcontroller";

function App() {
  return (
    <React.Fragment>
      <div className="App">
        <LedController />
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
        </header>
      </div>
    </React.Fragment>
  );
}

export default App;
